import React from "react";

import DropDownLivro from "./DropDownLivro"

import DropDownPessoa from "./DropDownPessoa"

const formularioEmprestimo = () => {
  return (
      <div className="container_midless">
        <div className="paddingContainer">
          <form>
            <label>
              Livro
            </label>
            <DropDownLivro/><br/>
            <label>
              Pessoa
            </label>
            <DropDownPessoa/>
          </form>
        </div>
      </div>
  );
};

export default formularioEmprestimo;
